import classNames from 'classnames';
import types from 'prop-types';
import React from 'react';
import './../../assets/images/image1.png'

// Styles

import './styles.scss';

// ----------------

export const Footer = () => {

  return <footer className="footer" style={{backgroundImage: 'url(${./../../assets/images/image1.png})'}}>

  </footer>;
};

// ----------------

// Type of props

Footer.propTypes = {
  prop: types.string,
};

// Default value for props

Footer.defaultProps = {};
